%octave sensitive to comments, use percent not number sign like for python%place function initial_model first in file. Else won't see itfunction ret = initial_model(n_hid)  n_params = (256+10) * n_hid;  as_row_vector = cos(0:(n_params-1));  as_row_vector= (0:(n_params-1));  fprintf('n_hid:%d n_params:%d as_row_vector:%dx%d numel:%d\n',n_hid, n_params, rows(as_row_vector),columns(as_row_vector),numel(as_row_vector));  disp(as_row_vector(1:20));  #ret = theta_to_model(as_row_vector(:) * 0.1); % We don't use random initialization, for this assignment. This way, everybody will get the same results.  ret = theta_to_model(as_row_vector(:));end